import './App.css'

const Subsection = (subsection) => {
	return(
		<div>
				<h3>Subsections</h3>



				{subsection.map((item) =>{
					return(
				<div>
				<h4>{item.number}  <button>Add Subsection</button></h4>

				<ul>
					<li>{item.location}</li>
					<li>Metting Times
						<ul>
						{
							item.details.map((subitem, i) => 
						<li>{i}:{subitem}</li>
						)
						}
						</ul>
					</li>
				</ul>) 
				</div>)}
				)
				}
			</div>

	)
}

